import React from 'react';
import Slider from "react-slick";

const imageList = [
    {
        name: "Photo 1",
        url: "../"
    }
]
class imageSlider extends React.Component {
    render() {
        const settings = {
            autoplay: true,
            dots: true,
            infinite: true,
        }
    }
}
export default Slider;
